void fill_call_vals ( db_val_t * prvals , call_lst * pcall , int ncnt ) { set_call_val ( prvals , CALLCOL_STATE , CALLCOL_STATE , & nstate ) ; if ( ! ncnt ) { return ; } set_call_val ( prvals , CALLCOL_MOHQ , CALLCOL_MOHQ , & pcall -> pmohq -> mohq_id ) ; set_call_val ( prvals , CALLCOL_CALL , CALLCOL_CALL , pcall -> call_id ) ; set_call_val ( prvals , CALLCOL_FROM , CALLCOL_FROM , pcall -> call_from ) ; set_call_val ( prvals , CALLCOL_CNTCT , CALLCOL_CNTCT , pcall -> call_contact ) ; set_call_val ( prvals , CALLCOL_TIME , CALLCOL_TIME , & pcall -> call_time ) ; return ; } 